import React from 'react';
import gql from 'graphql-tag';
import {Query} from 'react-apollo';

const LAUNCHES_QUERY = gql`
  query LaunchesQuery{
    launches{
      flight_number
      mission_name
      launch_year
      launch_date_local
      launch_success
    }
  }
`; 

function Launches() {
  return (
    <div>
      <h1 className='display-4 my-3 white'>Launches</h1>
    </div>
  )
}

export default Launches
